package com.home.commonBase.table.result;
import com.home.shine.table.BaseDBResult;

/** 服务器信息表(generated by shine) */
public class ServerDBResult extends BaseDBResult
{
	/** 创建时区服ID */
	public int areaID;
	
	/** 当前区服ID */
	public int nowAreaID;
	
	/** 服务器名(描述) */
	public String name="";
	
	@Override
	protected void toReadValues()
	{
		areaID=readInt();
		nowAreaID=readInt();
		name=readString();
	}
	
	@Override
	public Object getPrimaryKeyByIndex(int index)
	{
		switch(index)
		{
			case 0:
				return areaID;
		}
		
		return null;
	}
	
}
